import React from "react";
import { HStack, Heading } from "@chakra-ui/react";



export default function Menu(props) {
    return (
        <HStack direction="row" spacing={1600} backgroundColor="gray.900" shadow="md" >
            <Heading color="white" size="sm"  ml="5" mt="5" p="2">
                TorrPydo
            </Heading>


        </HStack>
  );
}
